import React from 'react';
import aboutData from '../data/about'
console.log(aboutData)

function About(props) {
  return (
    <div>
      <h1>About ProRide</h1>
      {aboutData.map((data, key) => {
        <p>{data}</p>
      })}
    </div>
  );
}

export default About;
